                                   "heading":null,
                                   "text":"&lt;ol&gt;\n&lt;li&gt;Pass tined wires ends through hole;&lt;/li&gt;\n&lt;li&gt;Bend loudspeaker wires ends 90 degrees;&lt;/li&gt;\n&lt;li&gt;Solder to the solder pad.&amp;nbsp;Wires should be under PCB;&lt;/li&gt;\n&lt;li&gt;Check that there is no short circuit.&lt;/li&gt;\n&lt;/ol&gt;"
