                             "changelog":"Mounting of O-ring pos.009 moved from PS3220",
                             "para":[
                                {
                                   "@language":"en",
                                   "@author":"216",
                                   "@translator":"",
                                   "heading":null,
                                   "text":"&lt;ol&gt;\n&lt;li&gt;Grease silicon pos.011 on spacer pos.008-1 and mount it on plug pos.008;&lt;/li&gt;\n&lt;li&gt;Mount smaller&amp;nbsp;hole of oring pos.009&amp;nbsp;on plug handel, it should fit in its slot, see photo;&lt;/li&gt;\n&lt;li&gt;Tight plug pos.008 on radio;&lt;/li&gt;\n&lt;li&gt;Grease silicon on pos.014&amp;nbsp;oring, and place it on SMA (from outside);&lt;/li&gt;\n&lt;li&gt;Clean extra silicone from main oring and radio;&lt;/li&gt;\n&lt;li&gt;Connect battery Jigg&amp;nbsp;to check if pogo pin gasket has a leakage. Multimeter screen should show OL(pic1). If there is other value ( ohm, Kohm or Mohm), inform responsible engineer;&lt;/li&gt;\n&lt;li&gt;&lt;span style=\"color: #ff0000;\"&gt;Make enviroment test according PS 3190 and then water test according PS 3203.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;"
                                },
                                {
                                   "@language":"no",
                                   "@author":"",
                                   "@translator":"",
                                   "heading":null,
                                   "text":"&lt;ol&gt;\n&lt;li&gt;Speaker Cover vaskes med sprit.&lt;/li&gt;\n&lt;li&gt;Limes med DowCorning. Se bilde&lt;/li&gt;\n&lt;li&gt;Klemmes på og herdes i 24 timer.&lt;/li&gt;\n&lt;/ol&gt;"
                                },
                                {
                                   "@language":"lt",
                                   "@author":"",
                                   "@translator":"216",
                                   "heading":null,
                                   "text":"&lt;ol&gt;\n&lt;li&gt;Užtepkite silikono poz.011 ant tarpinės poz.008-1 ir užmaukite ją ant kištuko poz.008;&lt;/li&gt;\n&lt;li&gt;Užmaukite tarpinės poz.009 mažesnę skylę ant \"jack\" kištuko, ji turi įsistatyti į griovelius, žiūrėti nuotrauką;&lt;/li&gt;\n&lt;li&gt;Prisukite kištuką poz.008 prie racijos;&lt;/li&gt;\n&lt;li&gt;Užtepkite silikono ant poz.014 tarpinės ir užmaukitę ją ant SMA jungties (iš išorės);&lt;/li&gt;\n&lt;li&gt;Nuvalykite papildomą silikono kiekį nuo didžiosios tarpinės ir racijos;&lt;/li&gt;\n&lt;li&gt;Įstatykite Jigg bateriją į raciją, kad patikrintumėte tarpinę. Multimetras turi rodyti OL (pav1). Jeigu multimetras rodo kitą reikšmę (ohm, Kohm arba Mohm), informuokite atsakingą inžinierių;&lt;/li&gt;\n&lt;li&gt;&lt;span style=\"color: #ff0000;\"&gt;Atlikite šalčio/karščio testus pagal PS 3190 ir tada vandens testą pagal PS 3203.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;"
                                }
                             ],
